import './App.css';
import Navbar from './components/Navbar/Navbar';
import Allindexs from './components/Allindexs/Allindexs';
import {Routes,Route} from 'react-router-dom'

function App() {
  return (
    <div className="app">
        <Navbar/>
        <Routes>
          <Route path='/' element={
            <>
              <Allindexs/>
            </>

          }/>
          <Route path='explorepage' element={<Explore/>}/>
        </Routes>      
    </div>
  );
}

export default App;
